import MainLayout from 'layout/MainLayout';

const Students = Loadable(lazy(() => import('pages/students')));

const StudentsRoutes = {
  path: '/',
  element: <MainLayout />,
  children: [
    {
      path: 'students',
      element: <Students />
    }
  ]
};

export default StudentsRoutes;
